nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","isCrawlable":true,"isLiveDvrEnabled":true,"thumbnail":{"thumbnails":[{"url":"https prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/"},"lengthSeconds":"0","ownerProfileUrl":"http://www.youtube.com/@forppgcpr","externalChannelId":"UCDbzZ9YQgF77C1RI_pNx0jQ","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR" jeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMIqvbE-8XZkAMVlI lickTrackingParams":"CBAQ040EGAQiEwiq9sT7xdmQAxWUg5UCHejCH43KAQQBT8z0","commandMetadata":{"webCommandMetadata":{"url":"/@forppgcpr","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCDbzZ9YQgF77C1RI_pNx0jQ","canonicalBaseUrl":"/@forppgcpr"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/KpMrcI0yPguHgFjIN11Eb8ZJAhLD9dZonDV8nIgiFHqklHny1KB6wjgHXpup_AbexbEpM0_3sw=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Mostrar mais"}},"simpleText":"...mais"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na
